public static Boolean toBooleanObject(String str) {
  if ("true".equalsIgnoreCase(str)) {
    return Boolean.TRUE;
  } else if ("false".equalsIgnoreCase(str)) {
    return Boolean.FALSE;
  }
  // no match
  return null;
}

